import axios from "axios";
import React, { useEffect, useState } from "react";
import { Helmet } from "react-helmet";
import { useDispatch } from "react-redux";
import headerImg from "../../../assets/icons/homeImage/reasechdevimg.png";
import { technologyData } from "../../../redux/action";
import Navbar3 from "../../Navbar/Navbar3";
import Header from "../../sections/Header";
import { renderHTML } from "../../utility/Helper";
import ResearchProducts from "./ResearchProducts";
import Card from "react-bootstrap/Card";

const ResearchandDevelopment2 = ({ headertData, metaTagsData }) => {
  const [isMobile, setIsMobile] = useState(window.innerWidth <= 768);
  const [RDData, setRDData] = useState();
  const [categoriesData, setcategoriesData] = useState(null);
  const [RDLoading, setRDLoading] = useState(true);
  const [expandedCategories, setExpandedCategories] = useState({0: true});
  const dispatch = useDispatch();

  useEffect(() => {
    const handleResize = () => setIsMobile(window.innerWidth <= 768);
    window.addEventListener("resize", handleResize);
    return () => window.removeEventListener("resize", handleResize);
  }, []);

  const getRDData = async () => {
    try {
      const response = await axios.get(`https://web.bluesurge.com.pk/rd`);
      setRDData(response.data.rd || {});
      setcategoriesData(response.data.rd.categories || {});

      dispatch(technologyData(response.data.rd || {}));
      setRDLoading(false);
    } catch (error) {
      console.log("Error fetching R&D data:", error);
      setRDLoading(false);
    }
  };

  useEffect(() => {
    if (RDLoading) getRDData();
  }, [RDLoading]);

  const toggleCategoryVisibility = (index) => {
    setExpandedCategories((prev) => ({ [index]: !prev[index] }));
  };

  return (
    <>
      <Helmet>
        <title>{metaTagsData?.researchTitle || "Blue Surge"}</title>
        <meta name="description" content={metaTagsData?.researchDescription || "Blue Surge Description"} />
        <meta name="keywords" content={metaTagsData?.researchKeywords || "Blue, Surge, keywords"} />
      </Helmet>

      <Navbar3 isMobile={isMobile} />
      <Header
        title={headertData?.researchHeading !== "undefined" && (
          <div dangerouslySetInnerHTML={renderHTML(headertData.researchHeading)} />
        )}
        description={headertData?.researchDescription !== "undefined" && (
          <div dangerouslySetInnerHTML={renderHTML(headertData.researchDescription)} />
        )}
        backgroundImage={
          headertData?.researchImage === "undefined"
            ? `https://admin.bluesurge.com.pk/uploads/${headertData.researchImage}`
            : headerImg
        }
        showButton={false}
      />

      <div className="research2-products">
        {RDLoading ? (
          <div className="loading-spinner">
            <i className="fa fa-spinner fa-5x fa-spin"></i>
          </div>
        ) : (
          <>
            {RDData.technology && (
              <div>
                <div className="first_heading center_heading">
                  <h2 className="first_title">
                    {RDData.heading && (
                      <span>
                        <div className="custom-text-style" style={{ color: "#137bf0", padding: "20px 0px" }} dangerouslySetInnerHTML={renderHTML(RDData.heading)} />
                        <div className="underline-part" style={{ width: "20%" }}></div>
                      </span>
                    )}
                  </h2>
                </div>

                <p className="research-development-section additional-width-class">
                  <div dangerouslySetInnerHTML={renderHTML(RDData.headingParagraph)} />
                </p>

                <div className="categories-section" style={{margin: '0px 0px 35px 0px'}}>
                  <div className="category-headings" style={{display: 'flex', flexWrap: 'wrap'}}>
                  {categoriesData && categoriesData.map((category, index) => (
                    <div key={index}>
                      <p onClick={() => toggleCategoryVisibility(index)}
                        style={{
                          color: '#137bf0',
                          border: '1px solid #137bf0',
                          width: 'fit-content',
                          padding: '10px',
                          borderRadius: '10px',
                          margin: '10px',
                          cursor: 'pointer',
                          backgroundColor: expandedCategories[index] ? 'rgba(19, 123, 240, 0.2)' : 'transparent',
                          transition: 'background-color 0.3s ease'
                        }}>
                        {category.parentCategoryName || "Unnamed Category"}
                      </p>
                    </div>
                  ))}
                  </div>
                  {categoriesData && categoriesData.map((category, index) => (
                    <div className="sub-categories">
                      {expandedCategories[index] && (
                        <div className="category-details" style={{ display: 'flex', gap: '30px' }}>
                          {category.subcategories?.length ? (
                            category.subcategories.map((subcategory, subIndex) => (
                              <div key={subIndex} className="subcategory">
                                <div className="margin-top">
                                  <Card
                                    className="product-card business-card"
                                    style={{
                                      backgroundColor: "#00193C",
                                      height: "auto",
                                      borderRadius: "0",
                                      border: 'none',
                                      margin: '0 auto',
                                      width: '80%'
                                    }}
                                  >
                                    <Card.Img
                                      className="card-img-no-border card-title"
                                      src={`https://admin.bluesurge.com.pk/uploads/f679e1fb-3980-4f82-ad78-1a95379bc0e7.jpeg`}
                                      style={{ width: 'auto' }}
                                      alt={`${subcategory.title} image`}
                                    />
                                    <Card.Body style={{ display: "flex", flexDirection: "column" }}>
                                      <Card.Title className="business-title-1">{subcategory.title}</Card.Title>
                                      <Card.Text>
                                        <div dangerouslySetInnerHTML={renderHTML(subcategory.description)} />
                                      </Card.Text>
                                    </Card.Body>
                                  </Card>
                                </div>
                              </div>
                            ))
                          ) : (
                            <p>No subcategories available</p>
                          )}
                        </div>
                      )}
                    </div>
                  ))}
                </div>
                
                <p className="research-development-section additional-width-class" style={{marginTop:'10px'}}>
                  <div dangerouslySetInnerHTML={renderHTML(RDData.technology)} />
                </p>
                
                {RDData.ourTeam && RDData.ourTeamDetail && (<>
                  <div style={{display: 'flex'}}>
                    <img
                      className="research-development-section additional-width-class"
                      src="data:image/png;base64,"
                      style={{ width: '350px' }}
                      alt="Innovation Image"
                    />
                    <div>
                      <div style={{display: 'flex'}}>
                        <img
                          src="data:image/png;base64,"
                          alt="Innovation Quote"
                          style={{ width: "100px", height: "auto" }}
                        />
                        <p className="research-development-section additional-width-class" style={{marginTop:'10px',color: "#137bf0", fontSize:'40px'}}>
                          <div dangerouslySetInnerHTML={renderHTML(RDData.ourTeam)} />
                        </p>
                      </div>
                      <p className="research-development-section additional-width-class" style={{marginTop:'10px'}}>
                        <div dangerouslySetInnerHTML={renderHTML(RDData.ourTeamDetail)} />
                      </p>
                    </div>
                  </div>
                  </>)}
              </div>
            )}
          </>
        )}
        <ResearchProducts />
      </div>
    </>
  );
};

export default ResearchandDevelopment2;